import React from 'react'
import "./Upload.css";
import Navbar from './Navbar';
import { FontAwesomeIcon } from '@fortawesome\/react-fontawesome';
import { faLinkedin, faTwitter, faInstagram } from '@fortawesome\/free-brands-svg-icons';

const Uploadpage = () => {
    return (
        <div>
            <Navbar/>
            <div className="bottom-container">
            <footer className="bg-light text-dark" style={{ marginTop: '0%' }}>
          <div className="BottomContainer" style={{ paddingLeft: '10%' }}>
            {/* Footer content */}
          </div>
          <div className="bg-light text-dark text-center py-3">
            <p>
              <FontAwesomeIcon icon={faCircle} style={{marginRight: '5px' }} />
              &copy; 2024-Defenzio. All rights reserved.
            </p>
          </div>
        </footer>  
            </div>
        </div>
    )
}

export default Uploadpage
